title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o19455.m14 -> o19492.m22 -> o19455.m14
  o19455.m6 -> o19492.m0 -> o19455.m20 -> o19455.m16 -> o19492.m0
  o19455.m16 -> o19492.m0 -> o19455.m20 -> o19455.m16
  o19455.m10 -> o19492.m0 -> o19455.m20 -> o19455.m16 -> o19492.m0
  o19455.m2 -> o19492.m0 -> o19455.m20 -> o19455.m16 -> o19492.m0
  o19455.m8 -> o19492.m0 -> o19455.m20 -> o19455.m16 -> o19492.m0
  o19455.m20 -> o19455.m16 -> o19492.m0 -> o19455.m20
  o19492.m22 -> o19455.m14 -> o19492.m22
  o19492.m0 -> o19455.m20 -> o19455.m16 -> o19492.m0

features:
  - inheritance
  - overriding
  - method
  - polymorphism

